import React from "react";
import "./Navbar.css"
import Logo from "../img/Logo.png"

const Navbar = () => {
    return (
        <div className="navbar">
          <div className="navbarcontainer">
            <div className="navlogo">
              <img src={Logo} alt="" />
            </div>
            <div className="navlinks">Links</div>
          </div>
        </div>
    )
}

export default Navbar
